import Layout from "../components/layout";
import AddressContent from "../components/address";
import { motion } from "framer-motion";

const Adresse = () => {
	return (
		<Layout>
			<motion.div exit={{ opacity: 0 }}>
				<AddressContent></AddressContent>
			</motion.div>
		</Layout>
	);
};

export default Adresse;
